import styled from "styled-components";
import * as Colors from "./colors";

const H3 = styled.h3`
  font-family: "Oswald", sans-serif;
  font-size: 1.75rem;
  color: ${Colors.DARK_CHOCOLATE};
  margin: 0;
`;
export default H3;
